import React from "react";
import Button from "../../UI/Button";
import "./CourseGoalInput.css";

const CourseGoalInput = () => {
  return (
    <form>
      <div className="form-control">
        <label>Course Goal</label>
        <input type="text" />
      </div>
      <Button />
    </form>
  );
};

export default CourseGoalInput;
